var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 個人倉儲 \n 個人網站 \n 個人簡報 \n 個人網誌 \n 組員 :  40523252 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Weeks', 'text': 'Week1 \n Week2~4 \n Week5~9 \n Week10~18 \n', 'tags': '', 'url': 'Weeks.html'}, {'title': 'Week1', 'text': 'Week1 \n 建立個人倉儲cd2021 \n 1.下載kmol2021_spring_v2.7z，完成後開啟。 \n 2.登入個人github帳號，使用老師的子模組創建新的倉儲cd2021。 \n 3.進入tmp。 \n 4.輸入git clone --recurse-submodules https://github.com/40623121/cd2021.git 取得子模組資料。 \n 5.完成後，進入cmsimde資料夾輸入python wsgi.py開始編輯倉儲。 \n 6.於瀏覽器輸入https://localhost:9443/ \n 7. 編輯完成後，輸入git status檢查 \xa0 -> \xa0 git add .全部新增 \xa0 -> \xa0 git commit -m "項目名稱" \xa0 -> \xa0 git push推送。\xa0 \xa0 \n \n \n \n 從英文單字解釋了解何謂協同? 產品? 設計? 以及實習? \n \n Collaborative 協同 \n 涉及兩個或多個為特殊目的而一起工作的人。 \n Product\xa0 產品 \n 為出售而製造或精製的物品或物質。 \n Design 設計 \n 為某物制定或繪製計畫。 \n Practice 練習 \n 實際去行動而不是單純去想或觀念。 \n \n \n 建立.leoID.txt \n 針對 Leo Editor 6.3 在 Windows 10 無法正確建立 home/.leo/.leoID.txt，且打開leo會產生一個無限迴圈，所以要在home_ipv6創建一個.leo資料夾，並新增一個有隨意字串的.leoID.txt檔。 \n \n \n \n \n 編輯\xa0Leo Editor \n', 'tags': '', 'url': 'Week1.html'}, {'title': 'Week2~4', 'text': '', 'tags': '', 'url': 'Week2~4.html'}, {'title': 'Week2', 'text': '第一階段分組協同實習 \n 制定組序 \n 動機 :\xa0 進行各班制定組序過程中, 發現即便採用 Ethercalc 以網際協同方式同步讓各班自選組員填入兩兩成組的學員學號, 但仍缺人工或自動定各班組序的有效方案，所以要說明自己認為最有效率的第一階段與訂定組序的方法及流程。 \n 使用程式碼 :\xa0 \n 人工 : 在教室前面的其中一台電腦做一個excel表單，並派班代負責key資料，找好組員的人派其中一個代表去報學號，key完後依序排組序下來，這樣不僅不會出錯，組序也不會亂掉。 \n 繪製零件 \n \n \n \n', 'tags': '', 'url': 'Week2.html'}, {'title': 'Week3', 'text': '', 'tags': '', 'url': 'Week3.html'}, {'title': 'Week5~9', 'text': 'Week5 \n', 'tags': '', 'url': 'Week5~9.html'}, {'title': 'Week10~18', 'text': '', 'tags': '', 'url': 'Week10~18.html'}]};